import React, { Component } from 'react';
import './App.css';
import { load_google_maps } from './utils.js';


class App extends Component {

  componentDidMount() {
    let googleMapsPromise = load_google_maps();

    Promise.all([
      googleMapsPromise
    ])
    .then(values => {
      console.log(values);
    })
  }

  render() {
    return (
    <main>
      <div id="map">
      </div>
      <div id="sidebar">
      </div>
    </main>
  );
  }
}

export default App;
